        "id":11,
        "title":"CRS79 Residence",
        "description":" The owners envisioned a home that is both discreet and bold, seamlessly blending into its natural surroundings while making a strong architectural statement. Nestled within a historic manor park, the landscape plays an integral role in the project - an element OAD saw as inseparable from the overall vision. In collaboration with Galantus, the landscape was meticulously designed to complement and enhance the architecture. From the street, the house remains nearly invisible, tucked behind a grassy embankment, while on the canal side, expansive windows and a rustic facade create a striking contrast. The design gradually reveals itself, beginning with a wild meadow garden where narrow, trimmed paths echo the organic flow of the architecture. As the building extends deeper into the property, its form evolves - what starts as a grounded volume rises into a more geometric composition, with the master bedroom appearing to float above the terrain in a futuristic, hovering design.",
